import React from 'react'
import styled from 'styled-components'
import heroImg from '../assets/img/hero.jpg'

const Home = () => {
  return (
    <>
    <Section>
        <Card>
            <Gorsel src={heroImg} />
        </Card>

        <Card>
            <h2>Spor Salonu</h2>
            <p>Salonumuza hoş geldiniz</p>
        </Card>

    </Section>

    <SectionIki>
    <CardIki>
            Kadın Spor
        </CardIki>
        <CardIki>
            Erkek Spor
        </CardIki>
        <CardIki>
            Çocuk Spor
        </CardIki>
    </SectionIki>
    </>
  )
}

const Section = styled.section`
    gap: 20px;
    background-color: #938378
`

const SectionIki = styled.section`
    display: flex;
    gap: 20px;
    background-color: #938378
    margin-top: 40px;
    padding: 30px;
`

const Card = styled.div`
    text-align: center;
    width: 45%;
    color: white;
`

const CardIki = styled.div `
    width: 30%;
    text-align: center;
    border: solid 1px gray;
    background-color: #494e4e;
    color: white;
    padding: 10px;
    border-radius: 10px;
`

const Gorsel = styled.img`
    height: 450px;
`

export default Home
